import React from "react";
import "./index.css";
import { Switch, Route, Redirect } from "react-router-dom";
import Board from "./components/Board";

import Home from "./components/Home";
import SignIn from "./components/SignIn";
import Intro1 from "./components/Intro1";
import Intro2 from "./components/Intro2";
import Intro3 from "./components/Intro3";
import Intro4 from "./components/Intro4";
import WhatsurNAme from "./components/WhatsUrName";

function App() {
  return (
    <div>
      <Switch>
        <Redirect exact from="/" to="/home" />
        <Route path="/home" component={Home} />
        <Route path="/sign-in" component={SignIn} />
        <Route path="/intro-1" component={Intro1} />
        <Route path="/intro-2" component={Intro2} />
        <Route path="/intro-3" component={Intro3} />
        <Route path="/intro-4" component={Intro4} />
        <Route path="/whats-ur-name" component={WhatsurNAme} />
        <Board />
      </Switch>
    </div>
  );
}

export default App;
